import CartTotal from '../CartTotal/CartTotal';

class CartSummary extends React.Component {
    render() {
        console.log(this.props)
        return (
            <div>
                <CartTotal
                    selectedFeatures={this.props.selectedFeatures} />
            </div>
        )
    }
}

export default CartSummary;
